	public static byte[] getBytesFromFile(File f) {
		if (f == null) {
			return null;
		}
		try {
			FileInputStream stream = new FileInputStream(f);
			ByteArrayOutputStream out = new ByteArrayOutputStream(1000);
			byte[] b = new byte[1000];
			int n;
			while ((n = stream.read(b)) != -1)
				out.write(b, 0, n);
			stream.close();
			out.close();
			return out.toByteArray();
		} catch (IOException e) {
		}
		return null;
	}

	private String creatFaceTokens(ArrayList<String> faceTokens){
		if(faceTokens == null || faceTokens.size() == 0){
			return "";
		}
		StringBuffer face = new StringBuffer();
		for (int i = 0; i < faceTokens.size(); i++){
			if(i == 0){
				face.append(faceTokens.get(i));
			}else{
				face.append(",");
				face.append(faceTokens.get(i));
			}
		}
		return face.toString();
	}


	private String getFaceToken(Response response) throws JSONException {
		if(response.getStatus() != 200){
			return new String(response.getContent());
		}
		String res = new String(response.getContent());
//		Log.e("response", res);
		JSONObject json = new JSONObject(res);
		String faceToken = json.optJSONArray("faces").optJSONObject(0).optString("face_token");
		return faceToken;
	}

	public void addFaceToFaceSet(CommonOperate commonOperate, String username, FaceSetOperate FaceSet, byte[] face){
		try{
			Response response = commonOperate.detectByte(face, 0, null);
			if (response.getStatus() != 200)
				throw new Exception();
			log.info(new String(response.getContent()));
			String token = getFaceToken(response);
			Response faceset = FaceSet.createFaceSet(null,"faceset",null,token, username, 1);
			if (faceset.getStatus() != 200)
				throw new Exception("add face to facset failed");
			log.info(new String(faceset.getContent()));
		}catch (Exception e){
			e.printStackTrace();
		}
	}

	public String serachFace(CommonOperate commonOperate, byte[] targetFace){
		try {
			Response response = commonOperate.searchByOuterId(null, null, targetFace, "faceset", 1);
			if (response.getStatus() != 200)
				throw new Exception("failed");
			log.info(new String(response.getContent()));
		} catch (Exception e) {
			e.printStackTrace();
		}
		return null;
	}

